import axios from "axios";

export const fetchModels = () => (dispatch) => {
  axios
    .post("http://127.0.0.1:8000/categories/", { category: "theory python" })
    .then((response) => {
      dispatch(actionsQuestionsTasks(response.data));
    })
    .catch((error) => {
      console.log(error);
    });
};

export const actionsQuestionsTasks = (obj) => ({
  type: "ACTIONS_QUESTIONS_TASKS",
  payload: obj,
});
